-- Add productFamily column if it doesn't exist
DO $$ 
BEGIN
  IF NOT EXISTS (SELECT 1 FROM information_schema.columns 
                 WHERE table_name='brand_literacy' AND column_name='productFamily') THEN
    ALTER TABLE brand_literacy ADD COLUMN "productFamily" TEXT NOT NULL DEFAULT 'Unknown';
  END IF;
END $$;

